operations.udf:
(t: ((Integer, Integer, Date), (Integer, Integer, Integer))) => {
  val supplierNation = t._2._2;
  val customerNation = t._2._3;
  val lExtended = 0.0 + t._1._2;
  val lDiscount = t._1._3;
  val lShipDate = t._1._3;
  val year = t._1._3.toString.substring(0,4).toInt;
  (supplierNation, customerNation, year, lExtended * (1.0 - lDiscount))
}

